import React from 'react';
import './dashboard.css';

const Dashboard = ({ username, onlogout }) => {
    return(
      <header className="header">
        <h2>Welcome, {username}!</h2>
        <button onClick={onLogout} className="logout-btn">Logout</button>
      </header>
    )
}
